local _ENV = _ENV
package.preload[ "std.strict" ] = function( ... ) local arg = _G.arg;
--[[
 Strict variable declarations for Lua 5.1, 5.2, 5.3 & 5.4.
 Copyright (C) 2006-2023 std.strict authors
]]
--[[--
 Diagnose uses of undeclared variables.

 All variables(including functions!) must be "declared" through a regular
 assignment(even assigning `nil` will do) in a strict scope before being
 used anywhere or assigned to inside a nested scope.

 Use the callable returned by this module to interpose a strictness check
 proxy table to the given environment.   The callable runs `setfenv`
 appropriately in Lua 5.1 interpreters to ensure the semantic equivalence.

 @module std.strict
]]


local setfenv = rawget(_G, 'setfenv') or function() end
local debug_getinfo = debug.getinfo


-- Return callable objects.
-- @function callable
-- @param x an object or primitive
-- @return *x* if *x* can be called, otherwise `nil`
-- @usage
--   (callable(functable) or function()end)(args, ...)
local function callable(x)
   -- Careful here!
   -- Most versions of Lua don't recurse functables, so make sure you
   -- always put a real function in __call metamethods.  Consequently,
   -- no reason to recurse here.
   -- func=function() print 'called' end
   -- func() --> 'called'
   -- functable=setmetatable({}, {__call=func})
   -- functable() --> 'called'
   -- nested=setmetatable({}, {__call=function(self, ...) return functable(...)end})
   -- nested() -> 'called'
   -- notnested=setmetatable({}, {__call=functable})
   -- notnested()
   -- --> stdin:1: attempt to call global 'nested' (a table value)
   -- --> stack traceback:
   -- -->	stdin:1: in main chunk
   -- -->		[C]: in ?
   if type(x) == 'function' or (getmetatable(x) or {}).__call then
      return x
   end
end


-- Return named metamethod, if callable, otherwise `nil`.
-- @param x item to act on
-- @string n name of metamethod to look up
-- @treturn function|nil metamethod function, if callable, otherwise `nil`
local function getmetamethod(x, n)
   return callable((getmetatable(x) or {})[n])
end


-- Length of a string or table object without using any metamethod.
-- @function rawlen
-- @tparam string|table x object to act on
-- @treturn int raw length of *x*
-- @usage
--    --> 0
--    rawlen(setmetatable({}, {__len=function() return 42}))
local function rawlen(x)
   -- Lua 5.1 does not implement rawlen, and while # operator ignores
   -- __len metamethod, `nil` in sequence is handled inconsistently.
   if type(x) ~= 'table' then
      return #x
   end

   local n = #x
   for i = 1, n do
      if x[i] == nil then
         return i -1
      end
   end
   return n
end


-- Deterministic, functional version of core Lua `#` operator.
--
-- Respects `__len` metamethod (like Lua 5.2+).   Otherwise, always return
-- one less than the lowest integer index with a `nil` value in *x*, where
-- the `#` operator implementation might return the size of the array part
-- of a table.
-- @function len
-- @param x item to act on
-- @treturn int the length of *x*
-- @usage
--    x = {1, 2, 3, nil, 5}
--    --> 5 3
--    print(#x, len(x))
local function len(x)
   return (getmetamethod(x, '__len') or rawlen)(x)
end


-- Like Lua `pairs` iterator, but respect `__pairs` even in Lua 5.1.
-- @function pairs
-- @tparam table t table to act on
-- @treturn function iterator function
-- @treturn table *t*, the table being iterated over
-- @return the previous iteration key
-- @usage
--    for k, v in pairs {'a', b='c', foo=42} do process(k, v) end
local pairs = (function(f)
   if not f(setmetatable({},{__pairs=function() return false end})) then
      return f
   end

   return function(t)
      return(getmetamethod(t, '__pairs') or f)(t)
   end
end)(pairs)


-- What kind of variable declaration is this?
-- @treturn string 'C', 'Lua' or 'main'
local function what()
   local d = debug_getinfo(3, 'S')
   return d and d.what or 'C'
end


return setmetatable({
   --- Module table.
   -- @table strict
   -- @string version release version identifier


   --- Require variable declarations before use in scope *env*.
   --
   -- Normally the module @{strict:__call} metamethod is all you need,
   -- but you can use this method for more complex situations.
   -- @function strict
   -- @tparam table env lexical environment table
   -- @treturn table *env* proxy table with metamethods to enforce strict
   --    declarations
   -- @usage
   --   local _ENV = setmetatable({}, {__index = _G})
   --   if require 'std._debug'.strict then
   --      _ENV = require 'std.strict'.strict(_ENV)
   --   end
   --   -- ...and for Lua 5.1 compatibility, without triggering undeclared
   --   -- variable error:
   --   if rawget(_G, 'setfenv') ~= nil then
   --      setfenv(1, _ENV)
   --   end
   strict = function(env)
      -- The set of declared variables in this scope.
      local declared = {}

      --- Environment Metamethods
      -- @section environmentmetamethods

      return setmetatable({}, {
         --- Detect dereference of undeclared variable.
         -- @function env:__index
         -- @string n name of the variable being dereferenced
         __index = function(_, n)
            local v = env[n]
            if v ~= nil then
               declared[n] = true
            elseif not declared[n] and what() ~= 'C' then
               error("variable '" .. n .. "' is not declared", 2)
            end
            return v
         end,

         --- Proxy `len` calls.
         -- @function env:__len
         -- @tparam table t strict table
         __len = function() return len(env) end,

         --- Detect assignment to undeclared variable.
         -- @function env:__newindex
         -- @string n name of the variable being declared
         -- @param v initial value of the variable
         __newindex = function(_, n, v)
            local x = env[n]
            if x == nil and not declared[n] then
               local w = what()
               if w ~= 'main' and w ~= 'C' then
                  error("assignment to undeclared variable '" .. n .. "'", 2)
               end
            end
            declared[n] = true
            env[n] = v
         end,

         --- Proxy `pairs` calls.
         -- @function env:__pairs
         -- @tparam table t strict table
         __pairs = function()
            return pairs(env)
         end,
      })
   end,
}, {
   --- Module Metamethods
   -- @section modulemetamethods

   --- Enforce strict variable declarations in *env*.
   -- @function strict:__call
   -- @tparam table env lexical environment table
   -- @tparam[opt=1] int level stack level for `setfenv`, 1 means
   --    set caller's environment
   -- @treturn table *env* which must be assigned to `_ENV`
   -- @usage
   --   local _ENV = require 'std.strict'(_G)
   __call = function(self, env, level)
      env = self.strict(env)
      setfenv(1 + (level or 1), env)
      return env
   end,

   --- Lazy loading of strict submodules.
   -- Don't load everything on initial startup, wait until first attempt
   -- to access a submodule, and then load it on demand.
   -- @function __index
   -- @string name submodule name
   -- @treturn table|nil the submodule that was loaded to satisfy the missing
   --    `name`, otherwise `nil` if nothing was found
   -- @usage
   --   local strict = require 'std.strict'
   --   local version = strict.version
   __index = function(self, name)
      local ok, t = pcall(require, 'std.strict.' .. name)
      if ok then
         rawset(self, name, t)
         return t
      end
   end,
})
end
end

-- title:   game title
-- author:  game developer, email, etc.
-- desc:    short description
-- site:    website link
-- license: MIT License (change this to your license of choice)
-- version: 0.1
-- script:  lua

local _ENV = require 'std.strict' (_G)

SCREEN_WIDTH = 240
SCREEN_HEIGHT = 136
GRAVITY = 0.10
MAX_SPIKES = 6
MIN_SPIKES = 2


bird = {x=SCREEN_WIDTH//2-8, y=SCREEN_HEIGHT//2-8, dx=1.5, dy=1}
ai_bird = {x=SCREEN_WIDTH//4, y=SCREEN_HEIGHT//4, dx=.5, dy=.5}
spikes = {left={}, right={}}
moving_spikes = {}
candy = {x=60, y=50, active=false}
powerup = {x=55, y=55, active=false}

game_mode = 1
is_mode_selected = false
difficulty = 1
is_difficulty_selected = false
selection_stage = "Game Mode"

is_game_active = false
score = 0
high_score = 0
reset_timer = 0
num_spikes = 3
last_powerup_used = 0

reaction_distance = 15

function draw_metasprite(spr_num, x, y)
--Function that makes it easier to draw a meta-sprite by drawing four sprites that make up a larger sprite
   spr(spr_num, x, y)
   spr(spr_num+1, x+8, y)
   spr(spr_num+16, x, y+8)
   spr(spr_num+17, x+8, y+8)
end

function create_spikes()
--creates the spikes that are shown at the start of the game
   spikes = {left={}, right={}}
   for i = 0, num_spikes-1 do
      table.insert(spikes.left, {x=-4, y=500})
      table.insert(spikes.right, {x=236, y=math.random(8,120)})
   end

   if game_mode == 1 then
      moving_spikes = {{x=50, y=90, dir=math.random(-1,1), speed=math.random(2, 5)}, {x = SCREEN_WIDTH-50, y=90, dir=math.random(-1,1), speed=math.random(2,5)}}
   end
end

function update_bird()
--function that moves the bird and takes in player input
   -- Horizontal movement
   bird.x = bird.x + bird.dx
   if bird.x <= 0 or bird.x >= 224 then
      score = score + 1
      bird.dx = -bird.dx
      for i=1, #spikes.left do
         spikes.left[i].y = math.random(8, 120)
         spikes.right[i].y = math.random(8, 120)
      end

      if not candy.active then spawn_candy() end
   end
   
   --Vertical movement
   bird.dy = bird.dy + GRAVITY
   bird.y = bird.y + bird.dy
   if bird.dy > 2 then bird.dy = 1.5 end

   --Jump mechanic
   if btnp(4) then 
      bird.dy = -2
   end
end

function update_ai_bird()
--moves the ai_bird to track the player
   --Horizontal tracking
   if ai_bird.x < bird.x then
      ai_bird.x = ai_bird.x + ai_bird.dx
   elseif ai_bird.x > bird.x then
      ai_bird.x = ai_bird.x - ai_bird.dx
   end
   
   --Vertical tracking
   if math.abs(bird.y - ai_bird.y) > reaction_distance then --delayed tracking to make it easier for the player to avoid
      if ai_bird.y < bird.y then
         ai_bird.y = ai_bird.y + ai_bird.dy
      elseif ai_bird.y > bird.y then
         ai_bird.y = ai_bird.y - ai_bird.dy
      end
   end
end

function update_spikes()
--determines when spikes locations are moved, and when spikes are added or removed
   if score ~= 0 and score % 10 == 0 and score ~= last_powerup_used then
      add_spike()
      last_powerup_used = score
   end

   if bird.dx > 0 then
      for _, spike in ipairs(spikes.left) do
         spike.y = 500
      end
   else
      for _, spike in ipairs(spikes.right) do
         spike.y = 500
      end
   end

   randomize_spikes(spikes.left)
   randomize_spikes(spikes.right)
end

function update_moving_spikes()
--controls vertical spikes movement
   for _, spike in ipairs(moving_spikes) do
      if spike.dir == 1 then
         spike.y = spike.y + spike.speed/10
         if spike.y >= SCREEN_HEIGHT-16 then
            spike.dir = -1
         end
      else
         spike.y = spike.y - spike.speed/10
         if spike.y <= 8 then
            spike.dir = 1
         end
      end
   end
end

function randomize_spikes(spikes)
--function that randomizes the spikes locations and ensures no overlapping between them
   for i = 1, #spikes do
      for j = 1, #spikes do
         if(i ~= j) then
            if math.abs(spikes[i].y - spikes[j].y) < 8 and spikes[i].y ~= 500 then 
               spikes[j].y = math.random(8, 120) 
            end
         end
      end
   end
end

function check_spike_collison()
--function that handles all collisions between the birds and spikes
   if (bird.y <= 4 or bird.y >= 116) then
      pause_game()
   end

   if bird.dx < 0 then
      for _, spike in ipairs(spikes.left) do
         if (bird.x < spike.x+8 and bird.x+14 > spike.x and
            bird.y < spike.y+4 and bird.y+10 > spike.y) then
               pause_game()
         end
      end
   elseif bird.dx > 0 then
      for _, spike in ipairs(spikes.right) do
         if (bird.x < spike.x+4 and bird.x+14 > spike.x-4 and
            bird.y < spike.y+4 and bird.y+10 > spike.y) then
               pause_game()
         end
      end
   end

   --Moving spikes
   if game_mode == 1 then
      for _, spike in ipairs(moving_spikes) do
         if (bird.x < spike.x+8 and bird.x+14 > spike.x and
             bird.y < spike.y+4 and bird.y+10 > spike.y) then
               pause_game()
         end 
      end
   end
end

function check_candy_collision()
--function that handles the collision detection for the bird and candy
   if (candy.active) and is_picked_up(bird, candy) then
         candy.active = false
         score = score + 1
   end
end

function check_powerup_collision()
--function that handles the collision between the bird and spike remover powerup
   if (powerup.active) and is_picked_up(bird, powerup) then
         powerup.active = false
         remove_spike()
         score = score + 1
   end
end

function check_ai_bird_collision()
--function that handles collision between the player and the ai_bird
   if game_mode == 2 then
      if (bird.x < ai_bird.x+12 and bird.x+12 > ai_bird.x and
         bird.y < ai_bird.y+12 and bird.y+12 > ai_bird.y) then
         pause_game()
      end
   end
end

function is_picked_up(a, b) -- useful for the powerups
--function that checks if a and b are colliding
   return a.x < b.x+16 and a.x+16 > b.x and
          a.y < b.y+16 and a.y+16 > b.y
end

function spawn_candy()
--spawns the candy in a random location that doesnt overlap with spikes
   candy.x = math.random(16, SCREEN_WIDTH-32)
   candy.y = math.random(16, SCREEN_HEIGHT-32)
   if game_mode == 1 then
      for i=1, 2 do
         if candy.x > moving_spikes[i].x-16 and candy.x < moving_spikes[i].x+8 then
            candy.x = math.random(16, SCREEN_WIDTH-32)
         end
      end
   end
   candy.active = true
end

function spawn_powerup()
--spawns the spike remover powerup in a random location that doesnt overlap with spikes
   powerup.x = math.random(16, SCREEN_WIDTH-32)
   powerup.y = math.random(16, SCREEN_HEIGHT-32)
   if game_mode == 1 then
      for i=1, 2 do
         if powerup.x > moving_spikes[i].x-16 and powerup.x < moving_spikes[i].x+8 then
            powerup.x = math.random(16, SCREEN_WIDTH-32)
         end
      end
   end
   --check_overlap()
   powerup.active = true
end

function draw_bird()
   if bird.dx > 0 then
      if bird.dy > 0 then draw_metasprite(0, bird.x, bird.y)
      else draw_metasprite(4, bird.x, bird.y) end
   else
      if bird.dy > 0 then draw_metasprite(2, bird.x, bird.y)
      else draw_metasprite(6, bird.x, bird.y) end
   end
end

function draw_ai_bird()
   if bird.x < ai_bird.x then
      draw_metasprite(66, ai_bird.x, ai_bird.y)
   else
      draw_metasprite(64, ai_bird.x, ai_bird.y)
   end
end

function draw_spikes()
--handles the y-coorindates to ensure no spikes overlap before it draws them
   for _, spike in ipairs(spikes.left) do
      spr(34, spike.x, spike.y)
   end
   for _, spike in ipairs(spikes.right) do
      spr(35, spike.x, spike.y)
   end

   --Moving spikes
   if game_mode == 1 then
      for _, spike in ipairs(moving_spikes) do
         spr(36, spike.x, spike.y)
      end
   end
end

function draw_candy()
   if candy.active then
      draw_metasprite(8, candy.x, candy.y)
   end
end

function draw_powerup()
   if  powerup.active then 
      draw_metasprite(10, powerup.x, powerup.y)
   end
end

function draw_game()
--draws all game elements 
   draw_bird()
   draw_spikes()
   draw_candy()
   draw_powerup()
   if game_mode == 2 then draw_ai_bird() end
end

function pause_game()
--sets a timer duration for the game to pause and stops the game
   reset_timer = 90
   is_game_active = false
end

function reset_game()
--resets initial game variable values
   if score > high_score then high_score = score end
   reset_timer = 0
   is_game_active = false
   bird.x = SCREEN_WIDTH//2-8
   bird.y = SCREEN_HEIGHT//2-8
   set_difficulty()
   bird.dy = 1
   score = 0
   candy.active = false
   powerup.active = false
   if game_mode == 2 then
      ai_bird.x = SCREEN_WIDTH//4
      ai_bird.y = SCREEN_HEIGHT//4
   end
   create_spikes()
end

function remove_spike() 
--removes a spike off each wall
   if num_spikes > MIN_SPIKES then
      table.remove(spikes.left, num_spikes)
      table.remove(spikes.right, num_spikes)
      num_spikes = num_spikes - 1
   end
end

function add_spike()
--adds a spike to each wall
   if num_spikes < MAX_SPIKES then
      table.insert(spikes.left, {x=-4, y=math.random(8,120)})
      table.insert(spikes.right, {x=236, y=math.random(8,120)})
      num_spikes = num_spikes + 1
   end
end

function check_overlap()
--ensures no overlap between the candy and powerup sprites
   if math.abs(candy.x - powerup.x) < 16 and math.abs(candy.y - powerup.y) < 16 then
      powerup.x = math.random(16, SCREEN_WIDTH-32)
      powerup.y = math.random(16, SCREEN_HEIGHT-32)
   end
end

function select_mode_screen()
--shows screen to select mode
   cls(12)
   print("Select Game Mode", 70, 40, 0)
   print("Press A for Mode 1 (Moving Spikes)", 30, 60, 1)
   print("Press B for Mode 2 (AI bird)", 30, 80, 1)
end

function select_difficulty_screen()
--shows screen to select difficulty
   cls(12)
   print("Select Difficulty: ", 70, 40, 0)
   print("Press A for Easy", 70, 60, 1)
   print("Press B for Medium", 70, 80, 1)
   print("Press X for Hard", 70, 100, 1)
end

function set_difficulty()
--sets the birds speed based on the difficulty
   if difficulty == 1 then
      bird.dx = 1
      ai_bird.dx = .4
      reaction_distance = 15
      num_spikes = 3
   elseif difficulty == 2 then
      bird.dx = 1.5
      ai_bird.dx = .75
      reaction_distance = 15
      num_spikes = 4
   elseif difficulty == 3 then
      bird.dx = 2
      ai_bird.dx = 1
      reaction_distance = 10
      num_spikes = 4
   end
end

function play_game()
--game logic
   if not is_mode_selected then
      select_mode_screen()
      if btnp(4) then 
         game_mode = 1 
         is_mode_selected = true
         selection_stage = "Difficulty"
      elseif btnp(5) then
         game_mode = 2
         is_mode_selected = true
         selection_stage = "Difficulty"
      end
   elseif not is_difficulty_selected and selection_stage == "Difficulty" then
      select_difficulty_screen()
      if btnp(4) then 
         difficulty = 1
         is_difficulty_selected = true
      elseif btnp(5) then
         difficulty = 2
         is_difficulty_selected = true
      elseif btnp(6) then 
         difficulty = 3
         is_difficulty_selected = true
      end
      set_difficulty()
      create_spikes()
   elseif is_mode_selected and is_difficulty_selected then
      map(0,0)
      draw_game()
      if reset_timer > 0 then
         reset_timer = reset_timer - 1
         if reset_timer == 0 then
            reset_game()
         end
      else
         if btnp(4) then
            is_game_active = true
         end
   
         if (is_game_active) then
            update_bird()
            update_ai_bird()
            check_spike_collison()
            check_candy_collision()
            check_powerup_collision()
            check_ai_bird_collision()
            check_overlap()
         end
         update_spikes()
         update_moving_spikes()

         if score ~= 0 and score%15 == 0 and (not powerup.active) then
            spawn_powerup()
         end
      end
      print(score, 116, 25, 0)
      print("High Score: " .. high_score, 90, 120, 0)
   end
end

function TIC()
   cls(12)
   play_game()
end



